import React from 'react'
import MainMenu from './components/Menu.js'
import { Player } from 'video-react'
import './App.css'


function App() {
  return (
          <div className = 'App'>
            <MainMenu></MainMenu>
            <Player 
                src='https://media.w3.org/2010/05/sintel/trailer_hd.mp4' 
                fluid = {false} 
                autoPlay = {true}
                width={100} height={50}
                className='Player'>
              </Player>
          </div>
        );
}

export default App;
